import React from 'react';
import TestimonialSlideshow from '../components/TestimonialSlideshow';
import '../styles/pages.css';

const Testimonials = () => {
  return (
    <div className="page-container">
      <div className="page-content">
        <h1>What Our Clients Say</h1>
        <p className="page-intro">
          Don't just take our word for it. Here's what our clients have to say about their experiences with RDS Events.
        </p>
        <div className="testimonials-section">
          <TestimonialSlideshow fullPage={true} />
        </div>
        <div className="cta-section">
          <h2>Ready to create unforgettable experiences?</h2>
          <p>Contact us today to discuss your next event.</p>
          <a href="/contact" className="cta-button">Get in Touch</a>
        </div>
      </div>
    </div>
  );
};

export default Testimonials;
